    function initMap() {
        // 地図の作成: 35.6823003,139.7306829
        var mapLatLng = new google.maps.LatLng({lat: 35.6823003,
                                                lng: 139.7306829}); // 緯度経度のデータ作成
        map = new google.maps.Map(document.getElementById('map'), { // #mapに地図を埋め込む
            center: mapLatLng, // 地図の中心を指定
            zoom: 13, // 地図のズームを指定
            styles: gmap_styles
        });
 
        // マーカー毎の処理
        for (var i = 0; i < markerData2.length; i++) {
            markerLatLng = new google.maps.LatLng({lat: parseFloat(markerData2[i]['lat']),
                                                    lng: parseFloat(markerData2[i]['lng'])}); // 緯度経度のデータ作成
            // マーカーiconを決める
            if(markerData2[i]['group'] == 'zxy'){
                markericon = 'https://maps.google.com/mapfiles/ms/icons/green-dot.png'
            }else if(markerData2[i]['group'] == 'workstyling'){
                markericon = 'https://maps.google.com/mapfiles/ms/icons/blue-dot.png'
            }else if(markerData2[i]['group'] == 'newwork'){
                markericon = 'https://maps.google.com/mapfiles/ms/icons/ltblue-dot.png'
            }else{
                // markericon = 'https://maps.google.com/mapfiles/ms/icons/yellow-dot.png'
                // markericon = 'https://maps.google.com/mapfiles/ms/icons/purple-dot.png'
                // markericon = 'https://maps.google.com/mapfiles/ms/icons/pink-dot.png'
                // markericon = 'https://maps.google.com/mapfiles/ms/icons/orange-dot.png'
                markericon = 'https://maps.google.com/mapfiles/ms/icons/red-dot.png'
            }
            marker[i] = new google.maps.Marker({ // マーカーの追加
                position: markerLatLng, // マーカーを立てる位置を指定
                map: map,  // マーカーを立てる地図を指定
                icon: markericon
            });
            infoWindow[i] = new google.maps.InfoWindow({ // 吹き出しの追加
                content: '<div class="map">予約/詳細: <a target="_blank" href="' + markerData2[i]['url'] + '">' + markerData2[i]['title'] + '</a></div>' // 吹き出しに表示する内容
            });
 
            markerEvent(i); // マーカーにクリックイベントを追加
        }
 
    }
    // マーカーにクリックイベントを追加
    function markerEvent(i) {
        marker[i].addListener('click', function() { // マーカーをクリックしたとき
            infoWindow[i].open(map, marker[i]); // 吹き出しの表示
        });
    }
</script>

